import React, { useState } from "react";
import { TextField, Button, Box } from '@mui/material';
import Card from "@mui/material/Card";
import { Grid } from "@mui/material";


const initialState = {
  name: '',
  email: '',
  message: '',
}

const MaterialFormComponent = (props) => {
  const [{ name, email, message }, setState] = useState(initialState)

  const handleChange = (e) => {
    const { name, value } = e.target
    setState((prevState) => ({ ...prevState, [name]: value }))
  }
  const clearState = () => setState({ ...initialState })

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(name, email, message)
  }
    return (
      <Card elevation={4} 
        sx={{width: "100%", height: "350px", padding: "10px", borderRadius: "5px", border: "2px solid green"}}
      > 
            <form onSubmit={handleSubmit} >

              <Grid container sx={{border: "2px solid blue", gap: "10px"}} alignItems="center" justifyContent="space-between" direction="row" >
                  <Grid item>
                      <TextField
                        id="firstName"
                        name="name"
                        label="First name"
                        type="text"
                        value={initialState.name}
                        onChange={handleChange}
                      />
                  </Grid>
                  <Grid item>
                      <TextField
                        sx={{width: "100%"}}
                        id="lastName"
                        name="email"
                        label="Last name"
                        type="text"
                        value={initialState.email}
                        onChange={handleChange}
                      />
                  </Grid>
              </Grid>
              <Grid container sx={{border: "2px solid black"}} alignItems="center" justify="center" direction="column" >
                <Grid item>
                    <TextField
                      id="lastName"
                      name="message"
                      label="Last name"
                      type="text"
                      value={initialState.message}
                      onChange={handleChange}
                    />
                </Grid>
                <Grid item>
                    <Button variant="contained" color="primary" type="submit" style={{
                        backgroundColor: "green",
                        margin: "5px"
                    }}>
                        Submit
                    </Button>
                </Grid>
              </Grid>
            </form>
      </Card>

    );
}
export default MaterialFormComponent;
